import TripData from "./TripData";
import "./trip_style.css";


export default function Trip(props){

    return(
        <div className="trip">
            <h1>props.h1</h1>
            <p></p>
            <div className="trip-card">
                {
                    props.dataList.map((item, index) => {
                        return(
                            <TripData key={index} data ={item}/>
                        );
                    })
                }
            </div>

        </div>
    );
}
